import React from 'react'
import PropTypes from 'prop-types'
import { withStyles } from '@material-ui/core/styles'
import { Card, CardHeader, CardContent } from '@material-ui/core'

const styles = {
	root: {

	},
  cardRoot: {
    maxWidth: 500,
    margin: '2rem auto',
  },
  cardHeader: {
    borderBottom: '1px solid #eee',
  },
}

const PricingTechky = (props) => (
	<div className={props.classes.root}>
		<Card className={props.classes.cardRoot}>
			<CardHeader title='Basic' subheader='$9.99 to sign up' className={props.classes.cardHeader}/>
			<CardContent>
				<p>1 free month</p>
				<p>Email support</p>
			</CardContent>
		</Card>
		<Card className={props.classes.cardRoot}>
			<CardHeader title='Pro' subheader='$9.99 to sign up' className={props.classes.cardHeader}/>
			<CardContent>
				<p>$4.99/month</p>
				<p>($29.99/year)</p>
				<p>Email support</p>
				<p>Phone support</p>
			</CardContent>
		</Card>
	</div>
)

PricingTechky.propTypes = {
  classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(PricingTechky)
